CREATE TABLE gares_sncf(
   Code_gare             INTEGER  NOT NULL PRIMARY KEY 
  ,Intitulé_gare         VARCHAR(55) NOT NULL
  ,Code_postal           INTEGER  NOT NULL
  ,Commune               VARCHAR(30)
  ,Département_Commune   VARCHAR(6)
  ,Département           VARCHAR(23)
  ,Région                VARCHAR(26)
  ,Région_SNCF           VARCHAR(33)
);
